import React from 'react';

export default class formWallet extends React.Component {
  render() {
    return (
      <form>
        <input type="text" placeholder="valor da despesa" data-testid="value-input" />
        <input type="text" placeholder="descrição da despesa" data-testid="description-input" />
        <select data-testid="currency-input" value="moeda"/>
        <select>
          <option>Dinheiro</option>
        </select>
      </form>
    );
  }
}
